import React, {useState} from 'react'
import './styles/reset.css'
import './styles/todo-item.css'
import TodoGroup from "./.components/todoGroup";


function App() {

    const [todosData, dataHandler] = useState([
        {
            title: "todoGroup1",
            groupId: 0,
            data:[
                {
                    id: 1,
                    title: "text Titel",
                    text: "text lorem bla bla",
                    startDate: "22.10",
                    endDate: "16.11"
                },
                {
                    id: 2,
                    title: "Title",
                    text: "lorem and nothing more",
                    startDate: "22.10",
                    endDate: "17.11"
                },
            ]
        },
        {
            title: "Group2",
            groupId: 1,
            data:[
                {
                    id: 1,
                    title: "tItle text",
                    text: " bla bla text lorem",
                    startDate: "22.10",
                    endDate: "16.11"
                },
                {
                    id: 2,
                    title: "nothing",
                    text: "nothing nothing nothing",
                    startDate: "22.10",
                    endDate: "16.11"
                },
            ]
        },
    ] )

    const addTodo = (newTodo) => {

        dataHandler(...todosData[newTodo.groupId], newTodo)
    }

    return (
        <div className="App">
            {
                todosData.map( todoGroup =>
                    <TodoGroup data={todoGroup} addTodo={addTodo}/>
                )
            }

        </div>
    )
}

export default App
